import React from "react";
import { BrowserRouter as Router, Link, Route, Routes } from "react-router-dom";
import { Navigation, Footer, Home, Contact, SignUp, SignIn, Doctprofile } from "./components";

class App extends React.Component {
  constructor() {
    super();
    this.state={
      isauthenticated:false
    }    
    this.getuser();
  }

  getuser() {
    e.preventDefault();
    axios.get("http://localhost:4000/signin",{ withCredentials: true })
    .then(res => this.setState({isauthenticated:res.data.isauthenticated}))
    .catch(error => console.log(error));
}

  //#region  Routers
  RouterHome() {
    if (true) {
      return (
        <Route exact path="/" element={<Home />} />
      )
    }
  }

  RouterSignUp() {
    if (true) {
      return (
        <Route path="/signup" element={<SignUp />} />
      )
    }
  }
  RouterSignIn() {
    if (this.state.isauthenticated) {
      return (
        <Route path="/signin" element={<SignIn />} />
      )
    }
  }
  RouterContact() {
    if (true) {
      return (
        <Route path="/contact" element={<Contact title="Contact" />} />
      )
    }
  }
  RouterDoctprofile() {
    if (false) {
      return (
        <Route path="/doctorNotAPP" element={<Doctprofile />} />
      )
    }
    else {
      return (
        <Route path="/doctorNotAPP" element={<SignIn />} />
      )
    }
  }
  //#endregion

  render() {
    return (
      <div className="App">
        <Router>
          <Navigation />
          <Routes>
            {this.RouterHome()}
            {this.RouterSignUp()}
            {this.RouterContact()}
            {this.RouterDoctprofile()}
            {this.RouterSignIn()}
          </Routes>
        </Router>
      </div>
    );
  }
}
export default App;
